 subject to these requirements. A requester may indicate that a code is not required by providing you with a Form W-9 with \u201CNot Applicable\u201D(or any similar. Indication) written or printed on the line for a FATCA exemption code.<br><br><b>Enter the appropriate FATCA reporting code in the online form</b><br/>A-An organisation exempt from tax under section 501(a) or any individual retirement plan as defined in section 7701(a)(37)<br>B-The United States or any of its agencies or instrumentalities<br>C-A state, the District of Columbia, a U.S. commonwealth or possession, or any of their political subdivisions or instrumentalities<br>D-A corporation the stock of which is regularly traded on one or more established securities markets, as described in Regulations section 1.1472-1(c)(1)(I)<br>E-A corporation that is a member of the expanded affiliated group as a corporation described in Regulations section 1.1472-1(c)(1)(i)<br>F-A dealer in securities, commodities, or derivative financial instruments(including notional principal contracts, futures, forwards, and options) that is registered as such under the laws of the United States or any state.<br>G-A real estate investment trust<br>H-A regulated investment company as defined in section 851 or an entity registered at all times during the tax year under the Investment Company Act of 1940<br>I-A common trust fund as defined in section 584(a)<br>J-A bank as defined in section 581<br>K-A broker<br>L-A trust exempt from tax under section 664 or described in section 4947(a)(1)<br>M-A tax exempt trust under a section 403(b) plan or section 457(g) plan.","errorText":"Invalid Exemption from Fatca Code"},"exempt_payee_code":{"label":"Exempt payee code (if any)","popup":"<b>Exempt payee code</b><ul><li>General Individuals (including Sole proprieters) are not exempted from backup withholding.</li><li>Exempt as provided below,corporations are exempt from backup withholding for certain payments, including interest and dividends.</li> <li>Corporations are not exempt from backup withholding for payments made in settlement of payment card or third party network transactions.</li><li>Corporations are not exempt from backup withholding with respect to attorneys, and corporations that provide medical or health care services are not exempt with respect to payments reportable or Form 1099-MISC. The following codes identify payees that are withholding.</li></ul> <br><br> <b>Enter the appropriate payee code in the online form</b><br>1-An organisation exempt from tax under section 501(a), any IRA, or a custodial account under section 403(b)(7) if the account satisfies the requirements of section 401(f)(2)<br>2-The United States or any of its agencies or instrumentalities<br>3-A state, the District of Columbia, a U.S. commonwealth or possession, or any of their political subdivisions, or instrumentalities<br>4-A foreign government or any of its political subdivisions, agencies or instrumentalities <br>5-A corporation<br>6-A dealer in securities or commodities required to register in the United States, the District of Columbia, or a U.S. commonwealth or possession<br>7-A future commission merchant registered with the Commodity Futures Trading Commission.<br>8-A real estate investment trust<br>9-An entity registered at all times during the tax year under the Investment Company Act of 1940<br>10-A common trust fund operated by a bank under section 584(a)<br>11-A financial institution<br>12-A middleman known in the investment community as a nominee or custodian<br>13-A trust exempt from tax under section 664 or described in section 4947.","errorText":"Invalid Exempt Payee Code"}},"components/MailingOptions":{"mail_options":{"title":"Update your tax info by mail or email","addressline":["PayPal Inc. Attn:  Information Reporting Operations<br>12312 Port Grace Blvd.<br>La Vista, NE 68128"],"w9_form":{"instructions":"<br><h4>Follow these steps to complete</h4><ol><li>Download and print the <a href='https://w